  \"the-breeding-biology-and-population-dynamics-of-the-black-tern-in-western-new-york\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The black tern is currently considered
  a migratory non-game bird of management concern by the US Fish and Wildlife Service
  Off ice of Migratory Bird Management and has been proposed as a candidate for listing
  as a federally endangered or threatened species. In New York, the species has recently
  been reclassified from \"special concern\" to \"endangered\".  Historically, in
  New York, black tern colonies were located in marshes along the shores of Lake Ontario
  and the St. Lawrence River, inland marshes in the western, central, and northeastern
  parts of the state, and an isolated site in the Adirondack Mountains. Today, the
  statewide population averages less than 300 breeding pairs and colonies in central
  New York, the Adirondacks, and Lake Ontario shores near Buffalo no longer exist.
  \ The goal of the habitat data analysis was to find the best fit model to explain
  the relationship between the response variable (ie, presence/absence of a nest or
  nest marsh/non-nest marsh) and the predictor variables (measured habitat variables
  from plots).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
